import React from 'react'
import './login.css'
const Login = () => {
    return (
        <div className="container">
            <div className="box">
                LOGIN!<br/><br/><br/>
                <input type="text" placeholder="Enter Username"></input><br/>
                <input type="password" placeholder="Enter Password"></input>
                <input type="checkbox"></input>
            </div>
        </div>
    )
}

export default Login;
